import React from 'react';
import {
    Routes,
    Route,
    Navigate
  } from "react-router-dom";
import './cnts/cnt.css';
import Main from "./main.js";
import Profile from "./profile.js";

import Desingbn from './design_bn';
import LandingPage from './landingpage';


function CntTable(){
  const shouldRedirect = true;
    return(
        <Routes>
            <>
            {shouldRedirect && <Navigate replace to="/portfolio/" />}
            </>
            <Route path="/" >
              <Route path="/" element={<Main />} />
              <Route
                  path="*"
                  element={
                    shouldRedirect ? (
                      <Navigate replace to="/portfolio/" />
                    ) : (
                      <Main />
                    )
                  }
                />
              <Route path="/portfolio/" element={<Main />} />
              <Route path="/portfolio/profile" element={<Profile />} />

              <Route path="/portfolio/wd/banner" element={<Desingbn />} />
              <Route path="/portfolio/wd/Landing" element={<LandingPage />} />
            
            </Route>
        </Routes>  
    );
}

export default CntTable;
